speechEnemy1=Mach nicht so viel Lärm|Don't make so much noise|Kannst du endlich leise sein|Can you finally be quiet|Musst du wirklich so laut reden|Do you really have to talk so loudly|Warum trampelst du ständig so rum|Why are you constantly stomping around|Es ist schon spät, hör auf mit dem Krach|It's already late, stop making that racket|Kannst du deine Musik leiser machen|Can you turn down your music|Denkt ihr gar nicht an eure Nachbarn|Don't you think about your neighbors at all|Immer dieser Lärm von euch|Always this noise from you|Es gibt auch Menschen, die arbeiten müssen|There are people who have to work, you know|Wenn das so weitergeht, rufe ich die Polizei|If this continues, I'll call the police
speechEnemy2=Guten Morgen, wie geht's Ihnen|Haben Sie gestern das Gewitter gehört|Did you hear the thunderstorm yesterday|Könnten Sie mir bitte helfen, dieses Paket zu tragen|Could you please help me carry this package|Brauchen Sie noch Zucker oder Milch|Do you need any sugar or milk|Schönes Wetter heute, oder|Nice weather today, isn't it|Haben Sie die neuen Nachbarn schon kennengelernt|Have you met the new neighbors yet|Könnten Sie bitte das nächste Mal die Mülltonne reinholen|Could you please bring in the trash can next time|Wenn Sie mal Werkzeug brauchen, sagen Sie einfach Bescheid|If you ever need tools, just let me know
